import './components.css'

function Footer(){
    return(
        <footer style={{color:'red'}}>
            <div>
                <img class='footer-dppa-logo' src="https://upload.wikimedia.org/wikipedia/en/thumb/9/99/UN_Department_of_Political_and_Peacebuilding_Affairs_logo.svg/500px-UN_Department_of_Political_and_Peacebuilding_Affairs_logo.svg.png"></img>
                <img class='footer-qcri-logo' src="https://pbs.twimg.com/profile_images/1302948780065554432/Ru7dPdwP.jpg"></img>
            </div>
        </footer>
    )
}

export default Footer;
